        private void FilterToday_Click(object sender, EventArgs e) {
            DataView view = new DataView(doctorsAppDataSet.schedule);
            view.RowFilter = $"date = '{DateTime.Today.ToString("yyyy-MM-dd")}'";
            table.DataSource = view;
        }

        private void FilterWeek_Click(object sender, EventArgs e) {
            DataView view = new DataView(doctorsAppDataSet.schedule);
            view.RowFilter = $"date >= '{DateTime.Today.ToString("yyyy-MM-dd")}' AND date < '{DateTime.Today.AddDays(7).ToString("yyyy-MM-dd")}'";
            table.DataSource = view;
        }

        private void FilterMonth_Click(object sender, EventArgs e) {
            DataView view = new DataView(doctorsAppDataSet.schedule);
            view.RowFilter = $"date >= '{DateTime.Today.ToString("yyyy-MM-dd")}' AND date < '{DateTime.Today.AddMonths(1).ToString("yyyy-MM-dd")}'";
            table.DataSource = view;
        }

        private void FilterReset_Click(object sender, EventArgs e) {
            table.DataSource = new DataView(doctorsAppDataSet.schedule);
        }
    }
}

import java.util.Scanner; // Импортирует класс Scanner для считывания данных с клавиатуры
import java.util.Hashtable; // Импортирует класса Hashtable для хранения данных в формате ключ-значение

public class var8 { // Объявляет публичный класс var8
    public static void main(String[] args) { // Объявляет главный метод main
        Scanner sc = new Scanner(System.in); // Создает объект Scanner для считывания данных с клавиатуры
        var8 obj = new var8(); // Создает объект класса var8
        Hashtable<String, Method> methods = new Hashtable<>(); // Создает хеш-таблицу для хранения методов запросов
        methods.put("POST", obj.new Method("POST", "Метод POST используется для отправки данных на сервер.")); // Добавляет метод POST в хеш-таблицу
        methods.put("GET", obj.new Method("GET", "Метод GET используется для получения данных с сервера.")); // Добавляет метод GET в хеш-таблицу

        Hashtable<Integer, StatusCode> statuses = new Hashtable<>(); // Создает хеш-таблицу для хранения кодов состояния
        statuses.put(200, obj.new StatusCode(200, "OK. Запрос успешно обработан сервером и ответ содержит запрашиваемый ресурс.")); // Добавляет код состояния 200 в хеш-таблицу
        statuses.put(400, obj.new StatusCode(400, "Bad Request. Сервер не может обработать запрос из-за неверного синтаксиса или недопустимых параметров.")); // Добавляет код состояния 400 в хеш-таблицу
        statuses.put(404, obj.new StatusCode(404, "Not Found. Сервер не может найти запрашиваемый ресурс.")); // Добавляет код состояния 404 в хеш-таблицу
        statuses.put(500, obj.new StatusCode(500, "Internal Server Error. Произошла внутренняя ошибка сервера.")); // Добавляет код состояния 500 в хеш-таблицу

        boolean exit = false; // Объявляет переменную exit для отслеживания выхода из цикла
        while (!exit) { // Начинает цикл while, пока exit не равен true
            System.out.print("1. Анализ IP-адреса\n2. Анализ методов запросов\n3. Анализ кода состояния\n0. Выход \nВаш выбор: "); // Выводит меню выбора операции
            String operation = sc.nextLine(); // Считывает выбранную операцию с клавиатуры

            switch (operation) { // Начинает блок switch-case для выбора операции
                case "1":
                    System.out.println("Введите IP-адрес: "); // Выводит приглашение ввода IP-адреса
                    String ipAddress = sc.nextLine(); // Считывает IP-адрес с клавиатуры
                    if (obj.validateIP(ipAddress)) { // Проверяет корректность IP-адреса
                        System.out.println("IP-адрес введен верно."); // Выводит сообщение об успешной проверке
                    } else {
                        System.out.println("IP-адрес введен неверно."); // Выводит сообщение об ошибке проверки
                    }
                    break;
                case "2":
                    System.out.println("Введите метод запроса: "); // Выводит приглашение ввода метода запроса
                    String methodName = sc.nextLine(); // Считывает метод запроса с клавиатуры
                    Method method = methods.get(methodName.toUpperCase()); // Получает метод запроса из хеш-таблицы
                    if (method == null) { // Проверяет, существует ли метод запроса
                        System.out.println("Неверный метод запроса."); // Выводит сообщение об ошибке
                    } else {
                        System.out.println("Метод " + method.getName() + ": " + method.getDescription()); // Выводит информацию о методе запроса
                    }
                    break;
                case "3":
                    System.out.println("Введите код состояния: "); // Выводит приглашение ввода кода состояния
                    int statusCode = sc.nextInt(); // Считывает код состояния с клавиатуры
                    StatusCode status = statuses.get(statusCode); // Получает код состояния из хеш-таблицы
                    if (status == null) { // Проверяет, существует ли код состояния
                        System.out.println("Неверный код состояния."); // Выводит сообщение об ошибке
                    } else {
                        System.out.println("Код состояния " + status.getCode() + ": " + status.getDescription()); // Выводит информацию о коде состояния
                    }
                    break;
                case "0":
                    exit = true; // Устанавливает exit в true для выхода из цикла
                    break;
                default:
                    System.out.println("Неверный выбор. Пожалуйста, выберите снова."); // Выводит сообщение об ошибке выбора
            }
        }
    }

    class Method { // Объявляет вложенный класс Method
        private String name; // Объявляет переменную name для хранения названия метода
        private String description; // Объявляет переменную description для хранения описания метода

        public Method(String name, String description) { // Объявляет конструктор класса Method
            this.name = name; // Устанавливает значение name
            this.description = description; // Устанавливает значение description
        }

        public String getName() { // Объявляет метод гет для name
            return name; // Возвращает значение name
        }

        public String getDescription() { // Объявляет метод гет для description
            return description; // Возвращает значение description
        }
    }

    class StatusCode { // Объявляет вложенный класс StatusCode
        private int code; // Объявляет переменную code для хранения кода состояния
        private String description; // Объявляет переменную description для хранения описания кода состояния

        public StatusCode(int code, String description) { // Объявляет конструктор класса StatusCode
            this.code = code; // Устанавливает значение code
            this.description = description; // Устанавливает значение description
        }

        public int getCode() { // Объявляет метод гет для code
            return code; // Возвращает значение code
        }

        public String getDescription() { // Объявляет геттер для description
            return description; // Возвращает значение description
        }
    }

    class Protocol { // Объявляет вложенный класс Protocol
        private int ip; // Объявляет переменную ip для хранения IP-адреса
        private String description; // Объявляет переменную description для хранения описания протокола

        public Protocol(int ip, String description) { // Объявляет конструктор класса Protocol
            this.ip = ip; // Устанавливает значение ip
            this.description = description; // Устанавливает значение description
        }

        public int getIp() { // Объявляет метод get для ip
            return ip; // Возвращает значение ip
        }

        public String getDescription() { // Объявляет метод гед для description
            return description; // Возвращает значение description
        }
    }

    boolean validateIP(String ipAddress) { // Объявляет метод validateIP для проверки корректности IP-адреса
        String[] parts = ipAddress.split("\\."); // Разделяет IP-адрес на части
        if (parts.length != 4) { // Проверяет, состоит ли IP-адрес из 4 частей
            return false; // Возвращает false, если IP-адрес не состоит из 4 частей
        }
        for (String part : parts) { // Перебирает части IP-адреса
            int number;
            try {
                number = Integer.parseInt(part); // Преобразует часть IP-адреса в целое число
            } catch (NumberFormatException e) { // Перехватывает исключение NumberFormatException (ошибку, если было введено не число)
                return false; // Возвращает false, если часть IP-адреса не является целым числом
            }
            if (number < 0 || number > 255) { // Проверяет, входит ли число в диапазон от 0 до 255
                return false; // Возвращает false, если число не входит в диапазон
            }
        }
        return true; // Возвращает true, если IP-адрес корректен
    }
}

@Composable
fun QuadrantComposable(text1: String, text2: String, color: Color, modifier: Modifier = Modifier) {
    Column(modifier = modifier
        .fillMaxSize()
        .background(color)
        .padding(16.dp),
        verticalArrangement = Arrangement.Center,
        horizontalAlignment = Alignment.CenterHorizontally) {
        Text(
            text = text1,
            fontWeight = FontWeight.Bold,
            modifier = modifier.padding(bottom = 16.dp)
        )

        Text(
            text = text2,
            textAlign = TextAlign.Justify
        )
    }
}

# Define the path to your JSON file
$jsonFilePath = 'setuptools.json'

# Read the JSON content from the file
$jsonContent = Get-Content $jsonFilePath | Out-String | ConvertFrom-Json

# The Python version to match or find a slightly lower version for
$targetPythonVersion = [version]"3.1.*"

# Function to check if a version satisfies the requirement
function Test-VersionCompatibility {
    param (
        [version]$requiredVersion,
        [string]$requiresPython
    )

    # Split the requirement string into versions, assuming format is ">=2.6,!=3.0.*,!=3.1.*,!=3.2.*"
    $versionConditions = $requiresPython -split ','

    foreach ($condition in $versionConditions) {
        if ($condition -match '>=?(\d+\.\d+)(\.(\d+))?') {
            $minVersion = [version]$Matches[1]
            if ($requiredVersion -lt $minVersion) {
                return $false
            }
        }
        elseif ($condition -match '<=?(\d+\.\d+)(\.(\d+))?') {
            $maxVersion = [version]$Matches[1]
            if ($requiredVersion -gt $maxVersion) {
                return $false
            }
        }
        elseif ($condition -match '!=?(\d+\.\d+)(\.(\d+))?') {
            $notVersion = [version]$Matches[1]
            if ($requiredVersion -eq $notVersion) {
                return $false
            }
        }
    }

    return $true
}

# Iterate through releases in reverse chronological order
$latestCompatibleRelease = $null
foreach ($release in ($jsonContent.releases.PSObject.Properties | Sort-Object Name -Descending)) {
    foreach ($package in $release.Value) {
        if ($null -ne $package.requires_python -and (Test-VersionCompatibility -requiredVersion $targetPythonVersion -requiresPython $package.requires_python)) {
            $latestCompatibleRelease = $release
            break
        }
    }
    if ($latestCompatibleRelease) {
        break
    }
}

# Output the found release
if ($latestCompatibleRelease) {
    $latestCompatibleRelease.Name
    $latestCompatibleRelease.Value | ConvertTo-Json
}
else {
    Write-Output "No compatible release found for Python $targetPythonVersion"
}

