#include <stdio.h>

int main() {
    
    int a, b, k;
    scanf("%d%d%d", &a, &b, &k);
    int zbir = 0;

    for(int i = a; i <= b; i++) {
        // prvo treba da najdeme kolku deliteli ima brojot i
        int broj_na_deliteli = 0;
        for(int c = 1; c <= i; c++) {
            if(i % c == 0) {
                broj_na_deliteli++;
            }
        }

        int do_kade = i - k;
        if(do_kade < 1) {
            do_kade = 1;
        }
        int k_deliv = 1;
        for(int j = i - 1; j >= do_kade; j--) {
            int deliteli_na_j = 0;
            // so ova gi naogame deliltelite na prethodnicite
            for(int u = 1; u <= j; u++) {
                if(j % u == 0) {
                    deliteli_na_j++;
                }
            }
            if(deliteli_na_j >= broj_na_deliteli) {
                k_deliv = 0;
            }
        }
        if(k_deliv == 1) {
            zbir += i;
        }
    }

    printf("%d\n", zbir);


       return 0;
}

#include <stdio.h>

int main() {
    
    int a, b;
    scanf("%d%d", &a, &b);

    for(int i = a; i <= b; i++) {
        int tmp = i, zbir = 0;

        while(tmp > 0) {
            int cifra = tmp % 10;
            zbir += cifra;
            tmp /= 10;
        }
        int deliteli = 0;
        for(int j = 1; j <= zbir; j++) {
            if(zbir % j == 0) {
                deliteli++;
            }
        }
        if(deliteli <= 2) {
            printf("%d ", i);
        }

    }
       return 0;
}

#include <stdio.h>

int main() {
    
    int a, b;
    scanf("%d%d", &a, &b);

    for(int i = a; i <= b; i++) {
        int tmp = i, broj = 0;
        while(tmp > 0) {
            int cifra = tmp % 10;
            broj = (broj * 10) + cifra;
            tmp /= 10;
        }
        if(i == broj) {
            printf("%d ", i);
        }
    }
    
       return 0;
}

#include <cmath>
#include <iostream>
#include <fstream>
#include <array>

const int N = 3;
const int number_of_generated_points = 100000;
const int area_size = 10;

class RungeKutta {
protected:

    double t;
    std::array<double, N> X, XH, K1, K2, K3, K4, FX;

public:

    RungeKutta() {
        X.fill(0);
        XH.fill(0);
        K1.fill(0);
        K2.fill(0);
        K3.fill(0);
        K4.fill(0);
        FX.fill(0);
    };

    double getX(int index) {
        return X.at(index);
    }

    //RungeKutta(const RungeKutta& other) : t(other.t), 
    //    X(other.X), XH(other.XH), K1(other.K1), K2(other.K2), K3(other.K3), K4(other.K4) {};

    void SetInit(double t0, std::array<double, N> X0) {
        t = t0;
        for (size_t i = 0; i < X.size(); i++)
            X[i] = X0[i];
    }

    virtual std::array<double, N> F(double t, std::array<double, N> X) = 0;

    void NextStep(double h) {
        if (h < 0) return;

        K1 = F(t, X);

        for (size_t i = 0; i < X.size(); i++)
            XH[i] = X[i] + K1[i] * (h / 2.0);

        K2 = F(t + h / 2.0, XH);

        for (size_t i = 0; i < X.size(); i++)
            XH[i] = X[i] + K2[i] * (h / 2.0);

        K3 = F(t + h / 2.0, XH);

        for (size_t i = 0; i < X.size(); i++)
            XH[i] = X[i] + K3[i] * h;

        K4 = F(t + h, XH);

        for (size_t i = 0; i < X.size(); i++)
            X[i] = X[i] + h / 6.0 * (K1[i] + 2.0 * K2[i] + 2.0 * K3[i] + K4[i]);

        t = t + h;
    }
};



class TA : public RungeKutta {
public:

    double b = 0.215; // bifurcation parameter

    TA() = default;

    std::array<double, N> F(double h, std::array<double, N> X) override {
        FX[0] = sin(X[1]) - b * X[0];
        FX[1] = sin(X[2]) - b * X[1];
        FX[2] = sin(X[0]) - b * X[2];
        return FX;
    }
};


