    scanf("%d", &n);

    int tmp = n;
    int broj = 0;
    while(tmp > 0) {
        int cifra = tmp % 10;
        broj = (broj * 10) + cifra;
        tmp /= 10;
    }
    printf("%d\n", broj);

    if(broj == n) {
